import AwesomeSlider from 'react-awesome-slider';
import 'react-awesome-slider/dist/styles.css';

const Home = () => {
  return (
    <div id='section' className='app'>
      <AwesomeSlider>
        <div>JEDEN</div>
        <div>DWA</div>
      </AwesomeSlider>
    </div>
  );
}

export default Home;
